import React from 'react';
import UserRow from './UserRow';
import '../css/leaderboard.css';

const IndividualLeaderboard = ({ number }: any) => {
  return (
    <div className="individual-leaderboard__container">
      <h1>{number}</h1>
      <UserRow />
    </div>
  );
};

export default IndividualLeaderboard;
